import React from 'react';
import { motion } from 'framer-motion';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <motion.div 
      className="home"
      initial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      transition={{ duration: 0.5 }}
    >
      <section className="hero">
        <motion.div 
          className="hero-content"
          initial={{ y: 20, opacity: 0 }}
          animate={{ y: 0, opacity: 1 }}
          transition={{ delay: 0.2, duration: 0.5 }}
        >
          <h1>Welcome to Blockchain Charity</h1>
          <p>Transparent, Secure, and Impactful Giving</p>
          <motion.div 
            className="cta-buttons"
            initial={{ y: 20, opacity: 0 }}
            animate={{ y: 0, opacity: 1 }}
            transition={{ delay: 0.4, duration: 0.5 }}
          >
            <Link to="/campaigns" className="btn btn-primary">Explore Campaigns</Link>
            <Link to="/create" className="btn btn-secondary">Start a Campaign</Link>
          </motion.div>
        </motion.div>
      </section>

      <section className="features">
        <motion.h2
          initial={{ y: 20, opacity: 0 }}
          whileInView={{ y: 0, opacity: 1 }}
          viewport={{ once: true }}
          transition={{ duration: 0.5 }}
        >
          Why Choose Blockchain Charity?
        </motion.h2>
        <div className="features-grid">
          {[
            {
              title: "Transparency",
              description: "Every donation is recorded on the blockchain, ensuring complete transparency.",
              icon: "🔍"
            },
            {
              title: "Security",
              description: "Smart contracts ensure your donations reach their intended recipients.",
              icon: "🔒"
            },
            {
              title: "Impact",
              description: "Track the real impact of your donations in real-time.",
              icon: "📈"
            }
          ].map((feature, index) => (
            <motion.div 
              key={feature.title}
              className="feature-card"
              initial={{ y: 20, opacity: 0 }}
              whileInView={{ y: 0, opacity: 1 }}
              viewport={{ once: true }}
              transition={{ delay: index * 0.2, duration: 0.5 }}
            >
              <span className="feature-icon">{feature.icon}</span>
              <h3>{feature.title}</h3>
              <p>{feature.description}</p>
            </motion.div>
          ))}
        </div>
      </section>

      <section className="how-it-works">
        <motion.h2
          initial={{ y: 20, opacity: 0 }}
          whileInView={{ y: 0, opacity: 1 }}
          viewport={{ once: true }}
          transition={{ duration: 0.5 }}
        >
          How It Works
        </motion.h2>
        <div className="steps">
          {[
            {
              step: "1",
              title: "Connect Wallet",
              description: "Connect your MetaMask wallet to get started"
            },
            {
              step: "2",
              title: "Choose Campaign",
              description: "Browse and select a campaign to support"
            },
            {
              step: "3",
              title: "Make Donation",
              description: "Donate ETH securely through smart contracts"
            }
          ].map((step, index) => (
            <motion.div 
              key={step.step}
              className="step-card"
              initial={{ x: -20, opacity: 0 }}
              whileInView={{ x: 0, opacity: 1 }}
              viewport={{ once: true }}
              transition={{ delay: index * 0.3, duration: 0.5 }}
            >
              <div className="step-number">{step.step}</div>
              <h3>{step.title}</h3>
              <p>{step.description}</p>
            </motion.div>
          ))}
        </div>
      </section>
    </motion.div>
  );
};

export default Home;
